import React from 'react';
import {cities} from '../api/cities';
function Form() {
    console.log(JSON.stringify(cities))

    return (
        <div>
            <select name="city">
                {
                    cities.map((city,index)=>{
                        <option key={index}>{city}</option>
                    })
                }
            </select>
        </div>
    );
}

export default Form;
